import { Card, Space } from "antd";

function TestCard({ networkDetails }) {
  return (
    <div>
      <Card
        headStyle={{
          color: "white",
          background: "#3E3D40",
        }}
        title={<p>Network Details</p>}
        style={{
          width: "100%",
          overflow: "hidden",
          color: "white",
          margin: "0 auto",
        }}
        bodyStyle={{ background: "#1F1E26", height: "211px" }}
      >
        <Space size={20}>
          <p>Protocol Type:</p>{" "}
          <p>
            <b>{networkDetails.ssid}</b>
          </p>
        </Space>
        <Space size={21}>
          <p>Protocol Type:</p>{" "}
          <p>
            <b>{networkDetails.wireless_standard}</b>
          </p>
        </Space>
        <Space size={22}>
          <p>Security Type:</p>{" "}
          <p>
            <b>{networkDetails.wireless_protocol}</b>
          </p>
        </Space>
        <Space size={15}>
          <p>Default Gateway</p>{" "}
          <p>
            <b>{networkDetails.default_gateway}</b>
          </p>
        </Space>
      </Card>
      <Card
        headStyle={{
          color: deviceDetails.status !== "Offline" ? "#16151b" : "white",
          textAlign: "center",
          background:
            deviceDetails.status === "Active"
              ? "#63D196"
              : deviceDetails.status === "Inactive"
              ? "#F9D14D"
              : "#F1544D",
        }}
        title={
          <div>
            {deviceDetails.status === "Active" ? (
              <b>ACTIVE</b>
            ) : deviceDetails.status === "Inactive" ? (
              <b>INACTIVE</b>
            ) : (
              <b>OFFLINE</b>
            )}
          </div>
        }
        style={{
          width: "100%",
          overflow: "hidden",
          color: "white",
          margin: "0 auto",
        }}
        bodyStyle={{ background: "#16151b" }}
      ></Card>
    </div>
  );
}

export default TestCard;
